uot;background-color: initial;&amp;quot;&amp;gt;-Sis. respiratorio&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font color=&amp;quot;#006600&amp;quot;&amp;gt;-Gran diversidad de ambientes: terrestres, agua dulce, marinos.&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#cc6600&amp;quot;&amp;gt;-Rádula: odontoforo con musculos retractores y protractores cubierto por una cinta dentada (rádula) con el que roen superficies duras para extraer el alimento.&amp;lt;/font&amp;gt; &amp;lt;font color=&amp;quot;#cc6600&amp;quot;&amp;gt;Ausente en bivalvos y en algunos solenogastres.&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;-Exoesqueleto: conchilla, valva, concha. Ausente o reducida en algunos, puede ser interna.&amp;lt;br&amp;gt;-Celoma reducido al area de las gonadas, corazon y riñones&amp;lt;br&amp;gt;-&amp;lt;b&amp;gt;Region anterior cefalica&amp;lt;/b&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;-&amp;lt;b style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;Pie muscular ventral&amp;lt;/b&amp;gt;&amp;lt;br&amp;gt;-&amp;lt;b&amp;gt;Masa visceral dorsal&amp;lt;/b&amp;gt;, cuvierta por repliege ectodermico llamado manto que secreta la conchilla.&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#004c99&amp;quot;&amp;gt;---&amp;lt;b&amp;gt;Cavidad del manto&amp;lt;/b&amp;gt; con organos de la respiracion (gen. branquias (&amp;lt;b&amp;gt;ctnenidios&amp;lt;/b&amp;gt;), tambien pulmonados)&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#737300&amp;quot;&amp;gt;-Desarrollo &amp;lt;b&amp;gt;indirecto&amp;amp;nbsp;&amp;lt;/b&amp;gt;con larva&amp;amp;nbsp;&amp;lt;b&amp;gt;trocofora&amp;lt;/b&amp;gt; y a veces larva&amp;amp;nbsp;&amp;lt;b&amp;gt;velíger &amp;lt;/b&amp;gt;(comienza a formar valva), en algunos casos desarrollo &amp;lt;b&amp;gt;directo&amp;lt;/b&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;br&amp; RE9-81\&quot; value=\&quot;&amp;quot;Caracoles&amp;quot;, &amp;quot;Babosas&amp;quot;, etc&amp;lt;i style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#4d4d4d&amp;quot;&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;G.&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;/i&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#4d4d4d&amp;quot;&amp;gt;&amp;lt;i style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;border-color: var(--border-color);&amp;quot; class=&amp;quot;headword-line&amp;quot;&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;border-color: var(--border-color);&amp;quot; class=&amp;quot;headword-line&amp;quot;&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;border-color: var(--border-color);&amp;quot; class=&amp;quot;headword-line&amp;quot;&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/i&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;i style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#4d4d4d&amp;quot;&amp;gt;găstḗr: estomago&amp;lt;/font&amp;gt;&amp;lt;/i&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;i style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#4d4d4d&amp;quot;&amp;gt;G. poús: pie&amp;lt;/font&amp;gt;&amp;lt;/i&amp;gt;&amp;lt;i&amp;gt;&amp;lt;font color=&amp;quot;#4d4d4d&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/i&amp;gt;\&quot; style=\&quot;text;html=1;align=left;verticalAlign=top;whiteSpace=wrap;rounded=0;glass=0;strokeColor=default;dashed=1;dashPattern=1 1;deletable=0;cloneable=0;movable=1;rotatable=0;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1400\&quot; y=\&quot;968.5899999999999\&quot; width=\&quot;150\&quot; height=\&quot;52.24\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;8r5dG47deWQDIl1KSRE9-82\&quot; value=\&quot;&amp;lt;u&amp;gt;Clase&amp;lt;/u&amp;gt;&amp;lt;br&amp;gt;Gastropoda\&quot; style=\&quot;rounded=0;whiteSpace=wrap;html=1;snapToPoint=0;treeFolding=0;fillColor=#EBDFBC;strokeColor=#6c8ebf;deletable=0;cloneable=0;movable=1;rotatable=0;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1399.07\&quot; y=\&quot;928.5899999999999\&quot; width=\&quot;118.45\&quot; height=\&quot;40\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;8r5dG47deWQDIl1KSRE9-83\&quot; value=\&quot;-Todos por encima de los 2-3cm, el calamar gigante llega a medir 18m y pesar una tonelada, es el invertebrado mas grande conocido&amp;lt;br&amp;gt;-En nautilus: concha con septos con el animal en la ultima division y el resto con gas que utilizan para la flotacion&amp;lt;br&amp;gt;-En calamares y sepias: concha interna quitinosa (pluma y jibón respectivamente)&amp;lt;br&amp;gt;-Concha ausente en pulpos&amp;lt;br&amp;gt;-Pie modificado en forma de sifon que usan para expeler agua y impulsarse rapidamente. Su borde anterior se prolonga en un circulo de brazos/tentaculos&amp;lt;br&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#36006e&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#004c99&amp;quot;&amp;gt;-Un par de branquias sin cilios,&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;font color=&amp;quot;#36006e&amp;quot;&amp;gt;-Sistema circulatorio &amp;lt;b&amp;gt;cerrado&amp;lt;/b&amp;gt;, con corazones branquiales que impulsan la sangre hacia la branquias para mejorar la circulacion&amp;lt;br&amp;gt;-Sistema nervioso muy bien desarrollado con un cerebro y neuronas distribuidas en el cuerpo, la mayoria en los brazos&amp;lt;br&amp;gt;-Ojos muy bien desarrollados analogos a los de los vertebrados, con córnea, cristalino, cámaras y retina&amp;lt;br&amp;gt;&amp;amp;nbsp;(excepto en nautilus que tiene ojos relativamente simples)&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#cc6600&amp;quot;&amp;gt;-Con rádula y mandibulas(&amp;quot;pico&amp;quot;), todos depredadores activos&amp;lt;/font&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#006600&amp;quot;&amp;gt;-Todos son marinos&amp;lt;br&amp;gt;-Cromatóforos en la superficie corporal, celulas con pigmentos que se expanden y contraen cambian el color del cuerpo para el camuflaje y la comunicacion&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;font color=&amp;quot;#36006e&amp;quot;&amp;gt;-Glandula de la tinta secreta sepia (liquido con melanina), expelen una nube de tinta como metodo de defensa para asistir en el escape (ausente en nautiloideos)&amp;lt;/font&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color); color: rgb(54, 0, 110);&amp;quot;&amp;gt;&amp;lt;font color=&amp;quot;#ff0000&amp;quot;&amp;gt;-&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#ff0000&amp;quot;&amp;gt;Dioicos, de fecundacion interna&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#737300&amp;quot;&amp;gt;-Sin estado larvario libre, de desarrollo directo&amp;lt;/font&amp;gt;&amp;lt;font color=&amp;quot;#737300&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;\&quot; style=\&quot;text;html=1;align=left;verticalAlign=top;whiteSpace=wrap;rounded=0;glass=0;strokeColor=default;dashed=1;dashPattern=1 1;fillColor=#99CCFF;treeFolding=0;collapsible=1;overflow=hidden;labelPadding=0;rotatable=0;deletable=0;cloneable=0;movable=1;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot; collapsed=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1550\&quot; y=\&quot;1030.83\&quot; width=\&quot;294\&quot; height=\&quot;80\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxRectangle x=\&quot;1550\&quot; y=\&quot;1030.83\&quot; width=\&quot;294\&quot; height=\&quot;510\&quot; as=\&quot;alternateBounds\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;8r5dG47deWQDIl1KSRE9-84\&quot; value=\&quot;-Gran variedad de tamaño, desde formas microscopicas a formas gigantes&amp;lt;br&amp;gt;-Una sola concha, con &amp;lt;b&amp;gt;torsion &amp;lt;/b&amp;gt;y &amp;lt;b&amp;gt;arollamiento&amp;lt;/b&amp;gt;, formas muy variadas. Puede estar ausente en algunos (e.g. babosas, nudibraquios). &amp;lt;b&amp;gt;Detorsion &amp;lt;/b&amp;gt;en algunos, aunque la torsion y el arrollamiento son el caracter ancestral&amp;lt;br&amp;gt;-Algunos poseen un &amp;lt;b&amp;gt;opérculo&amp;lt;/b&amp;gt; con el que pueden tapar la apertura de la concha&amp;lt;br&amp;gt;-Perdida de la simetria bilateral en algunos casos (por el arrollamiento)&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#36006e&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#737300&amp;quot;&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#004c99&amp;quot;&amp;gt;-Solo una branquia, algunos retienen dos, otros no tienen. Pulmonados con pulmon abierto al exterior por medio del pneumostoma&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#36006e&amp;quot;&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;/font&amp;gt;-Solo un nefridio en la mayoria&amp;lt;br&amp;gt;-Kleptocnidia y kleptoplastia&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;font color=&amp;quot;#36006e&amp;quot;&amp;gt;-Tres pares de ganglios, ojos o fotorreceptores sencillos, estatocistos, organos tactiles y quimiorreceptores&amp;lt;/font&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#cc6600&amp;quot;&amp;gt;-Con rádula, la mayoria herbivoros pero con gran variedad de habitos alimentarios (carroñeros, detrivoros, filtradores microfagicos, depredadores de cnidarios, bivalvos, annelidos, etc)&amp;lt;/font&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#006600&amp;quot;&amp;gt;-Gran variedad de habitats, comunes en mar desde zonas litorales a zonas de gran profundidad, otros pelagicos. Tambien de aguas salobres y dulces, y terrestres&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;font color=&amp;quot;#ff0000&amp;quot;&amp;gt;-&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#ff0000&amp;quot;&amp;gt;Monoicos o dioicos&amp;lt;br&amp;gt;-Pueden ser de fecundacion interna o externa, algunos ovoviviparos (e.g. caracoles dulciaquicolas)&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;font color=&amp;quot;#ff0000&amp;quot;&amp;gt;-Muchos realizan ceremonias de cortejo&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#737300&amp;quot;&amp;gt;-Larva trocófora, larva veliger, algunos pasan la fase veliger en el huevo y emergen como jovenes&amp;lt;/font&amp;gt;&amp;lt;font color=&amp;quot;#737300&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;\&quot; style=\&quot;text;html=1;align=left;verticalAlign=top;whiteSpace=wrap;rounded=0;glass=0;strokeColor=default;dashed=1;dashPattern=1 1;fillColor=#99CCFF;treeFolding=0;collapsible=1;overflow=hidden;labelPadding=0;deletable=0;cloneable=0;movable=1;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot; collapsed=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1680\&quot; y=\&quot;918.5899999999999\&quot; width=\&quot;294\&quot; height=\&quot;80\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxRectangle x=\&quot;1680\&quot; y=\&quot;918.5899999999999\&quot; width=\&quot;294\&quot; height=\&quot;492.24\&quot; as=\&quot;alternateBounds\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;8r5dG47deWQDIl1KSRE9-85\&quot; style=\&quot;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;entryX=0;entryY=1;entryDx=0;entryDy=0;exitX=1;exitY=0;exitDx=0;exitDy=0;endArrow=none;endFill=0;deletable=0;cloneable=0;movable=1;\&quot; parent=\&quot;1\&quot; source=\&quot;8r5dG47deWQDIl1KSRE9-87\&quot; target=\&quot;8r5dG47deWQDIl1KSRE9-89\&quot; edge=\&quot;1\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;8r5dG47deWQDIl1KSRE9-86\&quot; style=\&quot;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;entryX=0;entryY=0.75;entryDx=0;entryDy=0;endArrow=none;endFill=0;exitX=1;exitY=0;exitDx=0;exitDy=0;deletable=0;cloneable=0;movable=1;\&quot; parent=\&quot;1\&quot; source=\&quot;8r5dG47deWQDIl1KSRE9-87\&quot; target=\&quot;8r5dG47deWQDIl1KSRE9-88\&quot; edge=\&quot;1\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;8r5dG47deWQDIl1KSRE9-87\&quot; value=\&quot;-Dos valvas, derecha e izquierda, unidas por un ligamento dorsal&amp;lt;br&amp;gt;-Formacion de perlas como defensa ante cuerpos extraños que se insertan entre el manto y la concha&amp;lt;br&amp;gt;-Cabeza muy poco desarrollada&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#36006e&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#737300&amp;quot;&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#004c99&amp;quot;&amp;gt;-Branquias muy modificadas para la alimentacion por filtracion&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#36006e&amp;quot;&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#36006e&amp;quot;&amp;gt;-Organos sensoriales poco desarrollados, un par de estatocitos en el pie, un par de osfradios&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;-Sin ojos cefalicos, algunos con ojos en los bordes del manto&amp;lt;/font&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#cc6600&amp;quot;&amp;gt;-&amp;lt;b&amp;gt;Sin rádula&amp;lt;/b&amp;gt;, la mayoria filtradores. Algunos, como las bromas, perforan madera y se alimetan de ella, en simbiosis con bacterias que producen celulasa. Otras como las almejas gigantes consigen parte de su alimento de algas dinoflageladas que viven en los tejidos del manto&amp;lt;/font&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font color=&amp;quot;#006600&amp;quot;&amp;gt;-Marinos y algunos&amp;amp;nbsp;dulciacuícolas&amp;lt;/font&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;-Pie en forma de hacha&amp;lt;br&amp;gt;-En general seciles, pueden extender y enterrar el pie para desplazarse. Algunos nadan expulsando agua por el batir de las valvas, dirigida por los bordes del manto&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;font color=&amp;quot;#ff0000&amp;quot;&amp;gt;-&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#ff0000&amp;quot;&amp;gt;Generalmente diocos, de fertilizacion externa&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#737300&amp;quot;&amp;gt;-Con larva trocófora y viliger. Larva gloquidio, larva veliger especializada con dos valvas que parasita peces en algunas almejas de rio&amp;lt;/font&amp;gt;&amp;lt;font color=&amp;quot;#737300&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;\&quot; style=\&quot;text;html=1;align=left;verticalAlign=top;whiteSpace=wrap;rounded=0;glass=0;strokeColor=default;dashed=1;dashPattern=1 1;fillColor=#99CCFF;treeFolding=0;collapsible=1;overflow=hidden;labelPadding=0;resizable=1;fixedWidth=1;rotatable=0;deletable=0;cloneable=0;movable=1;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1612.41\&quot; y=\&quot;820.83\&quot; width=\&quot;297.59\&quot; height=\&quot;80\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxRectangle x=\&quot;1612.41\&quot; y=\&quot;820.83\&quot; width=\&quot;297.59\&quot; height=\&quot;400\&quot; as=\&quot;alternateBounds\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;8r5dG47deWQDIl1KSRE9-88\&quot; value=\&quot;\&quot; style=\&quot;shape=image;verticalLabelPosition=bottom;labelBackgroundColor=default;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/png,iVBORw0KGgoAAAANSUhEUgAAAsMAAAK+CAYAAABHMBNdAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAP+lSURBVHhe7J0HYBzVtf6/1faqVe+SJbn3ik2xTTWdJEACgbxQ0kjPey8h7/8S8hIgjTRIw6RQkgAplCQGklBjY8BUG9u4d1tWb6vtTf/znV2BMc0NsNH97PHuzs7OzMqae3/3zHfPsQyKYGRkZGRkZGRkZDQMVZB/NDIyMjIyMjIyMhp2MjBsZGRkZGRkZGQ0bGVg2MjIyMjIyMjIaNjKwL 83\&quot; width=\&quot;297.59\&quot; height=\&quot;80\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxRectangle x=\&quot;1612.41\&quot; y=\&quot;720.83\&quot; width=\&quot;297.59\&quot; height=\&quot;240\&quot; as=\&quot;alternateBounds\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;8r5dG47deWQDIl1KSRE9-93\&quot; value=\&quot;-No mas de 3cm&amp;lt;br&amp;gt;-Una unica conchilla pateliforme&amp;lt;br&amp;gt;-Pie ancho y plano&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#cc6600&amp;quot;&amp;gt;-Con rádula&amp;lt;/font&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#006600&amp;quot;&amp;gt;-Marinos&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;-Repeticion de organos (3-6 pares branquias, 3-7 pares metanefridios, 1-2 pares gonadas)&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#36006e&amp;quot;&amp;gt;-Sis. nervioso en escalera con 10 pares de nervios pedales&amp;lt;/font&amp;gt;\&quot; style=\&quot;text;html=1;align=left;verticalAlign=top;whiteSpace=wrap;rounded=0;glass=0;strokeColor=default;dashed=1;dashPattern=1 1;fillColor=#99CCFF;treeFolding=0;collapsible=1;overflow=hidden;labelPadding=0;rotatable=0;cloneable=0;deletable=0;movable=1;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot; collapsed=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1612.41\&quot; y=\&quot;640.83\&quot; width=\&quot;297.59\&quot; height=\&quot;60\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxRectangle x=\&quot;1612.41\&quot; y=\&quot;640.83\&quot; width=\&quot;297.59\&quot; height=\&quot;140\&quot; as=\&quot;alternateBounds\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;8r5dG47deWQDIl1KSRE9-94\&quot; value=\&quot;-Muy similar a caudofoveata&amp;lt;br&amp;gt;-Sin conchilla, manto cuvierto con escamas o espiculas calcareas&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#36006e&amp;quot;&amp;gt;-Sin cabeza&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#7d6a32&amp;quot;&amp;gt;-Sin organos excretores&amp;lt;/font&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font color=&amp;quot;#36006e&amp;quot;&amp;gt;-Pie modificado en un surco medio ventral&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;-&amp;lt;font style=&amp;quot;&amp;quot; color=&amp;quot;#ff0000&amp;quot;&amp;gt;Monoicos&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#004c99&amp;quot;&amp;gt;-Cavidad del manto posterior rudimentaria, sin verdaderas branquias&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#006600&amp;quot;&amp;gt;-Bentonicos, en el fondo del mar, a menudo sobre cnidarios de los que se alimentan&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#cc6600&amp;quot;&amp;gt;-Rádula generalmente ausente&amp;lt;/font&amp;gt;\&quot; style=\&quot;text;html=1;align=left;verticalAlign=top;whiteSpace=wrap;rounded=0;glass=0;strokeColor=default;dashed=1;dashPattern=1 1;fillColor=#99CCFF;treeFolding=0;collapsible=1;overflow=hidden;labelPadding=0;deletable=0;cloneable=0;movable=1;rotatable=0;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot; collapsed=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1790\&quot; y=\&quot;515.08\&quot; width=\&quot;294\&quot; height=\&quot;80\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxRectangle x=\&quot;1790\&quot; y=\&quot;515.08\&quot; width=\&quot;294\&quot; height=\&quot;180\&quot; as=\&quot;alternateBounds\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;8r5dG47deWQDIl1KSRE9-95\&quot; value=\&quot;-Entre 2 y 140mm&amp;lt;br&amp;gt;-Sin conchilla, manto cuvierto por cuticula quitinosa y espiculas calcareas&amp;lt;br&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#36006e&amp;quot;&amp;gt;-Sin cabeza&amp;lt;/font&amp;gt;&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;border-color: var(--border-color);&amp;quot; color=&amp;quot;#7d6a32&amp;quot;&amp;gt;-Sin organos excretores&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;-&amp;lt;font style=&amp;quot;&amp;quot; color=&amp;quot;#ff0000&amp;quot;&amp;gt;Dioicos&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#004c99&amp;quot;&amp;gt;-Un par de branquias&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#006600&amp;quot;&amp;gt;-Principalemente fosores, excavan en fondos blandos, se entierran verticalmente dejando la cavidad del manto y las branquias hacia la entrada de la cueva&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#cc6600&amp;quot;&amp;gt;-Se alimentan de microorganismos y detritus&amp;lt;br&amp;gt;-Escudo oral asociado con la seleccion y toma de alimento&amp;lt;br&amp;gt;-Generalmente con rádula&amp;lt;br&amp;gt;&amp;lt;/font&amp;gt;\&quot; style=\&quot;text;html=1;align=left;verticalAlign=top;whiteSpace=wrap;rounded=0;glass=0;strokeColor=default;dashed=1;dashPattern=1 1;fillColor=#99CCFF;treeFolding=0;collapsible=1;overflow=hidden;labelPadding=0;deletable=0;cloneable=0;movable=1;rotatable=0;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot; collapsed=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;1771\&quot; y=\&quot;430.83000000000004\&quot; width=\&quot;294\&quot; height=\&quot;80\&quot; as=\&quot;geometry\&quot;&gt;\n            &lt;mxRectangle x=\&quot;1771\&quot; y=\&quot;430.83000000000004\&quot; width=\&quot;294\&quot; height=\&quot;210\&quot; as=\&quot;alternateBounds\&quot; /&gt;\n          &lt;/mxGeometry&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;8r5dG47deWQDIl1KSRE9-96\&quot; value=\&quot;-Conchilla de 7-8 placas dorsales superpuestas, pueden enrollarse para protegerse&amp;lt;br&amp;gt;-Achatados dorsoventralmente&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#36006e&amp;quot;&amp;gt;-Cabeza y organos sensoriales cefalicos reducidos&amp;lt;br style=&amp;quot;border-color: var(--border-color);&amp;quot;&amp;gt;-Con estetes (órganos fotosensoriales) que atraviesan las placas y osfradios (quimiorreceptores) en los surcos del manto, cerca del ano&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#737300&amp;quot;&amp;gt;-Larva trocófora, sin larva veliger&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;-&amp;lt;font style=&amp;quot;&amp;quot; color=&amp;quot;#ff0000&amp;quot;&amp;gt;Dioicos&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#004c99&amp;quot;&amp;gt;-Numerosas branquias suspendidas del techo de la cavidad del manto, la cual esta extendida a los lados del pie. El pie y el borde del manto se adhieren al substrato formando dos camaras abiertas en los extremos por las que circula el agua.&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;-De 2 a 5 cm, los mas grandes llegan a 30cm&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#006600&amp;quot;&amp;gt;-Habitan mayormente superficies rocosas de areas intermarealeas, otros a grandes profundidades.&amp;lt;/font&amp;gt;&amp;lt;br&amp;gt;&amp;lt;font color=&amp;quot;#cc6600&amp;quot;&amp;gt;-Se alimentan de invertebrados que atrapan con una solapa cefalica y de algas que raspan con su&amp;amp;nbsp;&amp;lt;b&amp;gt;rádula&amp;lt;/b&amp;gt; reforzada con magnetita.&amp;lt;/font&amp;gt;\&quot; style=\&quot;text;html=1;align=left;verticalAlign=top;whiteSpace=wrap;rounded=0;glass=0;strokeColor=default;dashed=1;dashPattern=1 1;fillColor=#99CCFF;treeFolding=0;collapsible=1;overflow=hidden;labelPadding=0;deletable=0;cloneable=0;movable=1;rotatable=0;\&quot; parent=\&quot;1\&quot; vertex=\&qu
